import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import SellerHeader from "../component/SellerHeader";
import Footer from "../component/Footer";
import GifComponent from "../component/gif";
import SellerProductAd from "../component/"

function SellerHomePage() {
  const navigate = useNavigate();

  useEffect(() => {
    // Check if the seller is logged in by looking for a sellertoken or login status
    const sellertoken = localStorage.getItem('sellertoken');
    if (!sellertoken) {
      // If no sellertoken, redirect to login
      navigate("/sellerlogin");
    }
  }, [navigate]);

  return (
    <>
      <SellerHeader />
      <GifComponent />
      <div style={{ padding: "20px", maxWidth: "1200px", margin: "auto" }}>
        <h1 style={{ textAlign: "center", marginBottom: "20px", color: "green" }}>
          Seller Dashboard
        </h1>

        {/* Overview Section */}
        <section style={{ marginBottom: "40px" }}>
          <h2 style={{ color: "green", borderBottom: "2px solid green", paddingBottom: "10px" }}>
            Welcome, [Seller Name]
          </h2>
          <p style={{ fontSize: "16px" }}>
            Welcome to your seller dashboard. Here, you can manage your products, view your sales,
            respond to customer inquiries, and update your account information. Use the options
            below to navigate your dashboard and stay updated with your business on Kaca Bazar.
          </p>
        </section>

        {/* Action Links */}
        <section style={{ display: "flex", justifyContent: "space-around", marginBottom: "40px" }}>
          {/* Manage Products */}
          <div
            style={{
              border: "2px solid green",
              borderRadius: "10px",
              padding: "20px",
              textAlign: "center",
              width: "30%",
            }}
          >
            <h3 style={{ color: "green", marginBottom: "10px" }}>Manage Products</h3>
            <p>View, add, or update your product listings.</p>
            <button
              style={{
                backgroundColor: "green",
                color: "white",
                padding: "10px 20px",
                borderRadius: "5px",
                border: "none",
                cursor: "pointer",
              }}
            >
              Go to Products
            </button>
          </div>

          {/* View Sales */}
          <div
            style={{
              border: "2px solid green",
              borderRadius: "10px",
              padding: "20px",
              textAlign: "center",
              width: "30%",
            }}
          >
            <h3 style={{ color: "green", marginBottom: "10px" }}>View Sales</h3>
            <p>Track your sales performance and orders.</p>
            <button
              style={{
                backgroundColor: "green",
                color: "white",
                padding: "10px 20px",
                borderRadius: "5px",
                border: "none",
                cursor: "pointer",
              }}
            >
              View Sales
            </button>
          </div>

          {/* Customer Messages */}
          <div
            style={{
              border: "2px solid green",
              borderRadius: "10px",
              padding: "20px",
              textAlign: "center",
              width: "30%",
            }}
          >
            <h3 style={{ color: "green", marginBottom: "10px" }}>Customer Messages</h3>
            <p>View and respond to customer inquiries.</p>
            <button
              style={{
                backgroundColor: "green",
                color: "white",
                padding: "10px 20px",
                borderRadius: "5px",
                border: "none",
                cursor: "pointer",
              }}
            >
              Check Messages
            </button>
          </div>
        </section>

        {/* Account & Settings */}
        <section style={{ marginBottom: "40px" }}>
          <h2 style={{ color: "green", borderBottom: "2px solid green", paddingBottom: "10px" }}>
            Account & Settings
          </h2>
          <p style={{ fontSize: "16px" }}>
            Manage your account details, including updating your profile information, changing
            your password, and setting up payment options.
          </p>
          <button
            style={{
              backgroundColor: "green",
              color: "white",
              padding: "10px 20px",
              borderRadius: "5px",
              border: "none",
              cursor: "pointer",
            }}
          >
            Update Account Info
          </button>
        </section>

        {/* Support Section */}
        <section>
          <h2 style={{ color: "green", borderBottom: "2px solid green", paddingBottom: "10px" }}>
            Need Help?
          </h2>
          <p style={{ fontSize: "16px" }}>
            If you have any questions or need assistance, please contact our support team at{" "}
            <a href="mailto:support@kacabazar.com" style={{ color: "green" }}>
              support@kacabazar.com
            </a>
            .
          </p>
        </section>
      </div>
      <Footer />
    </>
  );
}

export default SellerHomePage;
